import { createIcon } from "../icon/createIcon";

export const TriangleDownIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="TriangleDownIcon">
    <path d="m11 3.5-5 5-5-5z" />
  </svg>,
  "TriangleDown",
  "triangle down"
);
